const Gettime =() =>{
    let Newtime = new Date().toLocaleDateString();
    return(
        <React.Fragment>
            <div className="get-time visiterClick">
                <h3>{Newtime}</h3>
                <button onClick>Get Time</button>
            </div>
        </React.Fragment>
    );
};
 export default Gettime;
